import React from 'react';
import './Student.css';

function Student(props) {
  const { name, birthdate, zodiacSign, favoriteMovieOrTVShow, hobbies, futureGoal, futureIn20Years } = props.data;

  return (
    <div className="student">
      <img className="student-photo" src="https://via.placeholder.com/150" alt="student" />
      <div className="student-name">{name}</div>
      <ul className="student-attributes">
        <li><strong>Birthdate:</strong> {birthdate}</li>
        <li><strong>Zodiac sign:</strong> {zodiacSign}</li>
        <li><strong>Favorite movie/TV show:</strong> {favoriteMovieOrTVShow}</li>
        <li><strong>Hobbies:</strong> {hobbies}</li>
        <li><strong>What I want to do in the future:</strong> {futureGoal}</li>
        <li><strong>Where do I see myself in 20 years:</strong> {futureIn20Years}</li>
      </ul>
    </div>
  );
}

export default Student;
